function App() {
  return (
    <div style={{ padding: '2rem', fontFamily: 'Arial, sans-serif' }}>
      <h1>NVIDIA Component Hub</h1>
      <p>React app is loading successfully!</p>
      <p>If you can see this, the React app is working.</p>
    </div>
  );
}

export default App;
